let root=ReactDOM.createRoot(document.getElementById('root'));
class Main extends React.Component{
  render(){
    return (
      <>
      <Heading/>
      </>
    )
  }
}
class Heading extends React.Component{
  render(){
    return(
    <div className='heading'>GAME HUB!</div>)
  }
}
